import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component {
  render() {

    const { animais } = this.props.pokemons;

    return(
      <div> 
        {animais.map((animal) => animal)}
      </div>
    )
  }
}

export default Pokedex;
